import React from "react";


function MobileMenu(){
    return(
        <nav class="mobile-nav">
            <a href="#home">Home</a>
            <a href="#descubra">Descubra</a>
            <a href="#guias">Guias</a>
            <a href="#sobre">Sobre</a>
            <a href="https://www.figma.com/file/s9Z908sPoAvhRyBKdFN1zl/Takan?node-id=0%3A1" target="_blank">Figma</a>
        </nav>
    )
}

export default MobileMenu
